import React, {Component} from 'react';
import {Card, Space, Tag} from "antd";
import blockStyle from './index.module.css';
import cover from '../../images/cover.jpg';
import {FireFilled, MessageFilled} from "@ant-design/icons";

class Block extends Component {
    render() {
        return (
            <Card className={blockStyle.card} cover={<img src={cover}/>} hoverable>
                <Space direction='vertical' size={12}>
                    <h3>言职区</h3>
                    <div className={blockStyle.describe}>
                        <p>言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言职区言
                            职区言职区言职区言职区言职区职区言职区言职区言职区言职区职区言职区言职区言职区言职区职区言职区言职区言职区言职区职区言职
                            区言职区言职区言职区职区言职区言职区言职区言职区职区言职区言职区言职区言职区
                        </p>
                    </div>
                    <div className={blockStyle.data}>
                        <Space size={40}>
                            <Tag icon={<MessageFilled />} color='#55acee'>30,000+</Tag>
                            <Tag icon={<FireFilled />} color='red'>12,000+</Tag>
                        </Space>
                    </div>
                </Space>
            </Card>
        );
    }
}

export default Block;
